import React from 'react';
import './nav.css';
import {Link} from 'react-router-dom';

function Nav() {
  return (
    <nav>
      <h1>Gabriel Peter</h1>
      <ul>
          <Link to='/'>
            <li>Resume</li>
          </Link>
          <Link to='/spotify'>
            <li>Spotify</li>
          </Link>
      </ul>
    </nav>

  );
}

export default Nav;
